import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import DisplayBlogLink from '../DisplayBlogLink/DisplayBlogLink.js';

class NavMenu extends Component {
    render() {
        return (
            <div>
                <Link to="/">Home</Link>
                <Link to="/write_blogs/" style={DisplayBlogLink}>Blogs</Link>
            </div>
        )
    }
}

export default NavMenu;
